def load_model():
    base_path = os.path.dirname(__file__)
    
    model_path = os.path.join(base_path, 'model_randomforest_upsampling_class_weight_balanced.pkl')
    scaler_path = os.path.join(base_path, 'scaler_randomforest_upsampling_class_weight_balanced.pkl')
    label_encoder_path = os.path.join(base_path, 'label_encoder.pkl')
    preprocessor_path = os.path.join(base_path, 'preprocessor.pkl')



    with open(model_path, 'rb') as file:
        model = pickle.load(file)
    with open(scaler_path, 'rb') as file:
        scaler = pickle.load(file)
    with open(label_encoder_path, 'rb') as file:
        label_encoder = pickle.load(file)
    with open(preprocessor_path, 'rb') as file:
        preprocessor = pickle.load(file)
    
    return model, scaler, label_encoder, preprocessor

